package vo;

public class Schedule {
	
	private int schedule_seq;
	private String start_date;
	private String end_date;
	private String title;
	private String content;
	private String flag;

	public Schedule() {
		// TODO Auto-generated constructor stub
	}

	public Schedule(int schedule_seq, String start_date, String end_date,
			String title, String content, String flag) {
		super();
		this.schedule_seq = schedule_seq;
		this.start_date = start_date;
		this.end_date = end_date;
		this.title = title;
		this.content = content;
		this.flag = flag;
	}

	public int getSchedule_seq() {
		return schedule_seq;
	}

	public void setSchedule_seq(int schedule_seq) {
		this.schedule_seq = schedule_seq;
	}

	public String getStart_date() {
		return start_date;
	}

	public void setStart_date(String start_date) {
		this.start_date = start_date;
	}

	public String getEnd_date() {
		return end_date;
	}

	public void setEnd_date(String end_date) {
		this.end_date = end_date;
	}

	public String getTitle() {
		return title;
	}

	public void setTitle(String title) {
		this.title = title;
	}

	public String getContent() {
		return content;
	}

	public void setContent(String content) {
		this.content = content;
	}

	public String getFlag() {
		return flag;
	}

	public void setFlag(String flag) {
		this.flag = flag;
	}

	@Override
	public String toString() {
		return "Schedule [schedule_seq=" + schedule_seq + ", start_date="
				+ start_date + ", end_date=" + end_date + ", title=" + title
				+ ", content=" + content + ", flag=" + flag + "]";
	}
}